import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import axios from 'axios';
import { FaFacebook, FaGoogle, FaTwitter } from 'react-icons/fa';
import { ToastContainer, toast } from 'react-toastify';
import 'react-toastify/dist/ReactToastify.css';

import AdminServices from '../services/AdminServices';
import './Authentication.css';

const Admin = () => {
    const [isLogin, setIsLogin] = useState(true);
    const [email, setEmail] = useState('');
    const [password, setPassword] = useState('');
    const [setUser] = useState(null);
    const [username, setName] = useState('');
    const [phoneNo, setPhoneNo] = useState('');
    const [location, setLocation] = useState('');
    const navigate = useNavigate();

    const handleLogin = async (e) => {
        e.preventDefault();
        try {
            const response = await axios.post('http://localhost:8090/api/v1/admins/login', { email, password });
            console.log('Login successful', response.data);
            toast.success('Login successful!');
            setUser(response.data);
        } catch (error) {
            console.error('Login failed', error.response.data);
            toast.error('Invalid email or password');
        }
    };

    const handleSignUp = async (e) => {
        e.preventDefault();

        const admin = { username, email, phoneNo, location, password };

        try {
            console.log('Creating admin with data:', admin); // Debug log
            const response = await AdminServices.createAdmin(admin);
            console.log('Account created successfully:', response.data); // Debug log
            toast.success('Account created successfully!');
            setIsLogin(true);
        } catch (error) {
            console.error('Failed to create account:', error); // Debug log
            toast.error('Failed to create account');
        }
    };

    return (
        <div className="background-container">
            <div className="auth-container">
                <div className="toggle-switch">
                    <button className={`toggle-button ${isLogin ? 'active' : ''}`} onClick={() => setIsLogin(true)}>
                        Admin Login
                    </button>
                    <button className={`toggle-button ${!isLogin ? 'active' : ''}`} onClick={() => setIsLogin(false)}>
                        Admin Sign Up
                    </button>
                </div>

                <div className="form-container">
                    {isLogin ? (
                        <>
                            <form onSubmit={handleLogin}>
                                <div className="form-group mb-3">
                                    <label>Email</label>
                                    <input
                                        type="email"
                                        className="form-control"
                                        value={email}
                                        onChange={(e) => setEmail(e.target.value)}
                                        required
                                    />
                                </div>
                                <div className="form-group mb-3">
                                    <label>Password</label>
                                    <input
                                        type="password"
                                        className="form-control"
                                        value={password}
                                        onChange={(e) => setPassword(e.target.value)}
                                        required
                                    />
                                </div>
                                <button type="submit" className="btn btn-success w-100 mb-3">Login</button>
                                <button
                                    type="button"
                                    className="btn btn-link w-100 mb-3"
                                    onClick={() => navigate('/forgot-password')}
                                >
                                    Forgot Password?
                                </button>
                            </form>
                            <div className="text-center mb-3">Or login with</div>
                            <div className="d-flex justify-content-around mb-3">
                                <FaFacebook size={32} style={{ cursor: 'pointer', color: 'white' }} />
                                <FaGoogle size={32} style={{ cursor: 'pointer', color: 'white' }} />
                                <FaTwitter size={32} style={{ cursor: 'pointer', color: 'white' }} />
                            </div>
                        </>
                    ) : (
                        <>
                            <form onSubmit={handleSignUp}>
                                <div className="form-group mb-2">
                                    <label>Name</label>
                                    <input
                                        type="text"
                                        className="form-control"
                                        value={username}
                                        onChange={(e) => setName(e.target.value)}
                                        required
                                    />
                                </div>
                                <div className="form-group mb-2">
                                    <label>Email</label>
                                    <input
                                        type="email"
                                        className="form-control"
                                        value={email}
                                        onChange={(e) => setEmail(e.target.value)}
                                        required
                                    />
                                </div>
                                <div className="form-group mb-2">
                                    <label>Phone No</label>
                                    <input
                                        type="text"
                                        className="form-control"
                                        value={phoneNo}
                                        onChange={(e) => setPhoneNo(e.target.value)}
                                        required
                                    />
                                </div>
                                <div className="form-group mb-2">
                                    <label>Location</label>
                                    <input
                                        type="text"
                                        className="form-control"
                                        value={location}
                                        onChange={(e) => setLocation(e.target.value)}
                                        required
                                    />
                                </div>
                                <div className="form-group mb-2">
                                    <label>Password</label>
                                    <input
                                        type="password"
                                        className="form-control"
                                        value={password}
                                        onChange={(e) => setPassword(e.target.value)}
                                        required
                                    />
                                </div>
                                <button type="submit" className="btn btn-success w-100 mb-3">Sign Up</button>
                            </form>
                        </>
                    )}
                </div>
            </div>
            <ToastContainer />
        </div>
    );
};

export default Admin;
